CREATE TABLE `log_book` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор записи погружения',
  `user_id` int unsigned NOT NULL COMMENT 'Идентификатор дайвера',
  `partner_id` int unsigned NOT NULL COMMENT 'Идентификатор напарника',
  `site_id` int unsigned NOT NULL COMMENT 'Идентификатор дайв-сайта',
  `dive_date` datetime DEFAULT NULL COMMENT 'Дата погружения',
  `dive_deep` int DEFAULT NULL COMMENT 'Глубина погружения',
  `dive_time` time NOT NULL DEFAULT '00:00:00' COMMENT 'Длительность погружения',
