  PRIMARY KEY (`id`),
  KEY `lb_user_id_fk` (`user_id`),
  KEY `lb_partner_id_fk` (`partner_id`),
  KEY `lb_site_id_fk` (`site_id`),
  CONSTRAINT `lb_partner_id_fk` FOREIGN KEY (`partner_id`) REFERENCES `members` (`id`) ON DELETE CASCADE,
  CONSTRAINT `lb_site_id_fk` FOREIGN KEY (`site_id`) REFERENCES `dive_sites` (`id`),
  CONSTRAINT `lb_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `members` (`id`) ON DELETE CASCADE
